import React from 'react';
import Navbar from './components/HomePage/Navbar';
import './Css/ContactPage.css';

function KampanyaliUrunler() {
    // Assume discountedProducts is an array containing discounted products
    const discountedProducts = []; // Replace this with your actual array of discounted products

    return (
        <div>
            {/* Check if there are discounted products */}
            {discountedProducts.length > 0 ? (
                <div>
                    {/* Render discounted products */}
                    <h2>Kampanyalı Ürünler</h2>
                    <ul>
                        {discountedProducts.map(product => (
                            <li key={product.id}>{product.name} - {product.price}</li>
                        ))}
                    </ul>
                </div>
            ) : (
                <div>
                    {/* If no discounted products, display a message */}
                    <p>Ekrana Kampanyalı Ürün bulunamadı</p>
                </div>
            )}
        </div>
    );
}

export default KampanyaliUrunler;
